import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import {Button, Card, Row, CardColumns, } from 'react-bootstrap'


function App() {
  return (
    <div className="App">

      <div>
      <p> why is so difficult?</p>
      <p><CardStuff/></p>
      </div>

      <Button1/>


    </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

export default App;
